import '../styles/NewForm.css'

class DrinkNew extends React.Component {
  render() {
    return (
      <div>
        <form>
          <div>
            <label>First name:</label>
            <input type="text" />
          </div>
          <div>
            <label>Last name:</label>
            <input type="text" />
          </div>
          <div>
            <input type="submit" value="Submit" />
          </div>
        </form>
      </div>
    );
  }
}

export default DrinkNew;
